import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the listings to load
    await page.waitForSelector('.listing-rating');

    // Extract IDs and ratings of listings with a rating of 4.8 or higher
    const listings = await page.$$eval('.listing-rating', elements => {
      return elements.map(el => {
        const rating = parseFloat(el.innerText);
        const id = el.closest('.listing-item').getAttribute('data-id'); // Assuming each listing has a data-id attribute
        return { id, rating };
      }).filter(listing => listing.rating >= 4.8);
    });

    // Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_extracted_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_extracted_data.png'));

    return {
      success: true,
      action: "Extracted listings with ratings of 4.8 or higher",
      extractedData: listings,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
